class Node:
    def __init__(self, key):
        self.left = None
        self.right = None
        self.val = key

def sortedArrayToBST(nums):
    if not nums:
        return None
    mid = len(nums) // 2
    node = Node(nums[mid])
    node.left = sortedArrayToBST(nums[:mid])
    node.right = sortedArrayToBST(nums[mid+1:])
    return node
